import './App.css';

function App() {
  const title = "welcome to my website";
  const like = 40;
  const person = { name: "John Doe", age: 30 };
  return (
    <div className="App">
      <div className='content'>
        <h1>{ title} </h1>
        <p>{person.name}</p>
      </div>
    </div>
  );
}

export default App;
